import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

class Car extends React.Component {
  render() {
    return <h2>Hi, I am a Car!</h2>;
  }
}

function Garage(){
  return (<>
  <h1>who live here</h1>
  <Car color="red"></Car>
  </>)
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Garage/>)
